type WordFilter struct {
    prefixes map[string]map[int]bool
    suffixes map[string]map[int]bool
	cache map[string]int
}

// O(len(word))
func generatePrefixes(word string) (prefixes []string) {
	for i := 1; i <= len(word); i++ {
		prefixes = append(prefixes, word[:i])
	}
	return
}

// O(len(word))
func generateSuffixes(word string) (suffixes []string) {
	for i := 0; i < len(word); i++ {
		suffixes = append(suffixes, word[i:])
	}
	return
}

// O(len(words) * len(word))
func Constructor(words []string) WordFilter {
	wordFilter := WordFilter{
		prefixes: make(map[string]map[int]bool),
		suffixes: make(map[string]map[int]bool),
		cache: make(map[string]int),
	}
    
	for i, word := range words {
		for _, prefix := range generatePrefixes(word) {
			_,ok := wordFilter.prefixes[prefix]
			if !ok {
				wordFilter.prefixes[prefix] = map[int]bool{}
			}
			wordFilter.prefixes[prefix][i] = true
		}
		for _, suffix := range generateSuffixes(word) {
			_,ok := wordFilter.suffixes[suffix]
			if !ok {
				wordFilter.suffixes[suffix] = map[int]bool{}
			}
			wordFilter.suffixes[suffix][i] = true
		}
    }
	return wordFilter
}

func max(a, b int) int {
	if a > b {
		return a
	}
	return b
}

// O(len(prefixes))
func (this *WordFilter) F(prefix string, suffix string) int {
	id := fmt.Sprintf("%v#%v", prefix, suffix)
	val, ok := this.cache[id]
	if ok {
		return val
	}

    prefixes, foundPrefix := this.prefixes[prefix]
	suffixes, foundSuffix := this.suffixes[suffix]
	maxMatch := -1

	if foundPrefix && foundSuffix {
		if len(prefixes) < len(suffixes) {
			for index := range prefixes {
				if suffixes[index] {
					maxMatch = max(maxMatch, index)
				}
			}
		} else {
			for index := range suffixes {
				if prefixes[index] {
					maxMatch = max(maxMatch, index)
				}
			}
		}
	}

	this.cache[id] = maxMatch
	return maxMatch
}